
public class Dataset {
	private double dis;
	private double ang;
	private double h;
	public Dataset(double distance, double angle, double height) {
		// TODO Auto-generated constructor stub
		dis = distance;
		ang = angle;
		h = height;
	}
	public double getDistance() {
		return dis;
	}
	public double getAngle() {
		return ang;
	}
	public double getHeight() {
		return h;
	}

}
